Reading 18: Integration of Financial Statement Analysis Techniques
0:00 Introduction and Learning Outcome Statements
3:01 Demonstrate the use of a framework for the analysis of financial statements, given a particular problem, question, or purpose (e.g., valuing equity based on comparable, critiquing a credit rating, obtaining a comprehensive picture of financial leverage, evaluating the perspectives given in management‚Äôs discussion of financial results);
16:53 Identify financial reporting choices and biases that affect the quality and comparability of companies‚Äô financial statements and explain how such biases may affect financial decisions;
27:54 Evaluate the quality of a company‚Äôs financial data and recommend appropriate adjustments to improve quality and comparability with similar companies, including adjustments for differences in accounting standards, methods, and assumptions;
34:46 Evaluate how a given change in accounting standards, methods, or assumptions affects financial statements and ratios;
37:48 Analyze and interpret how balance sheet modifications, earnings normalization, and cash flow statement related modifications affect a company‚Äôs financial statements, financial ratios, and overall financial condition.

Reinforcement learning based on deep learning is currently being used for impressive control of fluid dynamic systems.  This video will describe recent advances, including for mimicking the behavior of birds and fish, for turbulence closure modeling with sub-grid-scale models, and for robotic flight demonstrations.  

