Readings 5 ‚Äì Multiple Regression
0:00 Introduction and Learning Outcome Statements
0:54 LOS: Formulate a multiple regression equation to describe the relation between a dependent variable and several independent variables and determine the statistical significance of each independent variable
3:24 LOS: Interpret estimated regression coefficients and their p-values;
6:12 LOS: Formulate a null and an alternative hypothesis about the population value of a regression coefficient, calculate the value of the test statistic, and determine whether to reject the null hypothesis at a given level of significance;
11:57 LOS: Interpret the results of hypothesis tests of regression coefficients;
13:40 LOS: Calculate and interpret 1) a confidence interval for the population value of a regression coefficient and 2) a predicted value for the dependent variable, given an estimated regression model and assumed values for the independent variables;
16:44 LOS: Explain the assumptions of a multiple regression model
17:45 LOS: Calculate and interpret the F-statistic, and describe how it is used in regression analysis
23:15 LOS: Distinguish between and interpret the R2 and adjusted R2 in multiple regressions
27:47 LOS: Evaluate how well a regression model explains the dependent variable by analyzing the output of the regression equation and an ANOVA table;
32:15 LOS: Formulate a multiple regression equation by using dummy variables to represent qualitative factors and interpret the coefficients and regression results
39:12 LOS: Explain the types of heteroskedasticity and how heteroskedasticity and serial correlation affect statistical inference;
43:50 LOS: Describe multicollinearity and explain its causes and effects in regression analysis;
47:22 LOS: Describe how model misspecification affects the results of regression analysis and describe how to avoid common forms of misspecification;
48:59 LOS: Describe models with qualitative dependent variables
50:41 LOS: Evaluate and interpret a multiple regression model and its results

JavaScript Tutorial for beginners - Learn JavaScript from Scratch

Learn the JavaScript - Web programming language. With JavaScript, you can make your webpages dynamic, using features like interactive forms,  picture slideshows, and sophisticated menu systems and many more.

After completing this lesson, you will be able to:
‚Ä¢ Describe the basic syntax of JavaScript;
‚Ä¢ Explain how to work with variables in JavaScript;
‚Ä¢ Describe how to control the flow of a JavaScript application with control statements;
‚Ä¢ Outline the use of functions and prototypes in JavaScript;
‚Ä¢ Explain the use of client-side JavaScript with HTML;
‚Ä¢ Describe how JavaScript integrates with the document object model (DOM);
‚Ä¢ List the common APIs used in JavaScript Applications.
